import React from "react";
import './Dog.css'
import {Route, Link} from 'react-router-dom';





const Dog = (dog)=>{
    if (!dog) return <Link to="/"/>

    return (
      <div className="Dog">

          <img src={dog.src} alt={dog.name} />
          <div>
          <h2>{dog.name}</h2>
          <h3>{dog.age} years old</h3>
          <ul>
            {dog.facts.map((fact, i) => (
              <li key={i}>{fact}</li>
            ))}
          </ul>
          <Link to="/dogs">Go Back</Link>
        </div>
      </div>
    );
}

export default Dog;
